svg.script:
(function() {
(function startOnScrollIntoView(id, threshold) {
    const el = document.getElementById(id);
    if (el) new IntersectionObserver((e) => {e.forEach(i => {
                    if (i.isIntersecting) el.classList.add("_px_animate", "_px_running");
            if (i.isIntersecting) el.classList.remove("_px_paused");
            if (!i.isIntersecting) el.classList.add("_px_paused");
            if (!i.isIntersecting) el.classList.remove("_px_running");
    });}, { threshold }).observe(el);
})("_px_2khovjbo", 0.5);

})();
